    <script>
        const divs = document.querySelectorAll('.address-highlight');
        divs.forEach(el => el.addEventListener('click', event => {
            var a = document.getElementsByTagName('li');
            for (i = 0; i < a.length; i++) {
            }
            const itemId = event.target.getAttribute("data-item-id");
            event.target.classList.add('active')
            const textElement = document.getElementById(itemId);
            const attrDisplay = textElement.getAttribute('display');
            if (attrDisplay === 'none'){
                textElement.setAttribute('display','block')
            }else{
                event.target.classList.remove('active')
                textElement.setAttribute('display','none')

            }


        }));
        window.onload = () => {
            const eduActives = document.querySelectorAll('.education .address-highlight');
            eduActives.forEach(el => {
                el.classList.add('active')
            })

            const eduActiveMaps = document.querySelectorAll('.locate.education');

            eduActiveMaps.forEach(el => {
                el.setAttribute('display','block')
            })

        }

        const svgElement = document.querySelector('#map');
        const btnZoomIn = document.querySelector('#zoom-in');
        const btnZoomOut = document.querySelector('#zoom-out');

        let scale = 1.2;

        function zoomIn() {
            scale += 0.2;
            svgElement.style.transform = `scale(${scale})`;
        }

        function zoomOut() {
            if (scale > 0.2) {
                scale -= 0.2;
                svgElement.style.transform = `scale(${scale})`;
            }
        }

        document.getElementById('zoom-in').addEventListener('click', zoomIn);
        document.getElementById('zoom-out').addEventListener('click', zoomOut);


        const headings = document.querySelectorAll('h2');

        headings.forEach((heading) => {
            heading.addEventListener('click', () => {
                const ul = heading.nextElementSibling;

                if (ul && ul.tagName.toLowerCase() === 'ul') {
                    ul.classList.toggle('show'); // Thêm hoặc xóa lớp show
                }
            });
        });

    </script>
    <script>
        document.addEventListener("DOMContentLoaded", () => {
            const lazySvgs = document.querySelectorAll("svg.lazy-load-svg");

            if ("IntersectionObserver" in window) {
                const observer = new IntersectionObserver((entries, observer) => {
                    entries.forEach(entry => {
                        if (entry.isIntersecting) {
                            const svg = entry.target;

                            const imgs = svg.querySelectorAll("image");
                            imgs.forEach((img) => {
                                const imgSrc = img.getAttribute("data-url");
                                if (imgSrc) {
                                    img.setAttributeNS("http://www.w3.org/1999/xlink", "href", imgSrc);
                                    img.removeAttribute("data-src");
                                }
                            })

                            observer.unobserve(svg);
                        }
                    });
                });

                lazySvgs.forEach(svg => observer.observe(svg));
            } else {
                lazySvgs.forEach(svg => {
                    const imgs = svg.querySelectorAll("image");
                    imgs.forEach((img) => {
                        const imgSrc = img.getAttribute("data-url");
                        if (imgSrc) {
                            img.setAttributeNS("http://www.w3.org/1999/xlink", "href", imgSrc);
                            img.removeAttribute("data-src");
                        }
                    })

                });
            }
        });
    </script>
